import React, { useState } from 'react'
import axios from 'axios'
function Side_work() {
const [userdata, setuserdata] = useState([])

  const fetchdata=async()=>{
    const res=await axios.get("https://picsum.photos/v2/list?page=2&limit=10")

    console.log(res.data);

    setuserdata(res.data)
    
  }
  let printdata="user not found"
  if(userdata.length>0){
    printdata=userdata.map(function(elem,index){
      return(
    <div>
      <img  className='h-2 w-3' src={elem.download_url} alt="" />
    </div>
      )
    })
  }


  return ( 
   <div className='bg-dark text-white text-center w-100'>

      <button className=' btn btn-danger m-5' onClick={fetchdata} > GetData</button>
      {printdata}
     
      
</div>
  )
}

export default Side_work
